    const characters = 'ABCDEFGHIKLMNOPQRSTUVWXYZabcdefghijklmnopqrstuvwxyz0123456789';
    const codeLenght = length || 6;
    let code = ''
    for (let i = 0; i < codeLenght; i++){
        Math.floor(Math.random() * characters.length+1);
    }
}


export default function HostForm() {
    return (
        <div className="container">
            <h2>On est host ouuu !</h2>
            <div>
                <Formik>
                    <Form>
                        <fieldset className="form-group">
                            <label htmlFor="" className="form-label">Nom de la room</label>
                            <Field type="text" className="form-control" name="room-name"></Field>
                        </fieldset>
