                            <label htmlFor="" className="form-label">Code</label>
                            <Field type="" className="form-control" name="room-code"></Field>
                        </fieldset>
                        <div>
                            <button className="btn-close-white">CREATE ROOM</button>
                        </div>
                    </Form>
                </Formik>
            </div>
        </div>
    )
}
